import React, { useState, useEffect } from 'react';

const LogItem = () => {
  const [log, setLog] = useState([
    {
      id: 1,
      message: 'test log message testing',
      kilo: 2,
      attention: true,
      launderer: 'Jenny Smith',
    },
    {
      id: 2,
      message: 'Laundry from ben apartment room 03',
      kilo: 1,
      attention: true,
      launderer: 'Dina Santos',
    },
  ]);

  useEffect(() => {
    setLog();
  }, []);
  return (
    <>
      <li className='collection-item'>
        <div>
          <a href='#edit-log-modal'>{log}</a>
          <br />
          <a href='#!' className='secondary-content' style={{ color: 'red' }}>
            <i className='material-icons'>delete</i>
          </a>
          <span>
            2 Kilo - Launderer: Jane Doe, updated by Admin July 01, 2020
          </span>
        </div>
      </li>
      <li className='collection-item'>
        <div>
          <a href='#edit-log-modal'>Clickable title to edit the log as modal</a>
          <br />
          <a href='#!' className='secondary-content' style={{ color: 'red' }}>
            <i className='material-icons'>delete</i>
          </a>
          <span>
            2 Kilo - Launderer: Jane Doe, updated by Admin July 01, 2020
          </span>
        </div>
      </li>
    </>
  );
};

export default LogItem;
